シアターサイズ 約69 ×102cm<BR>

60年代後半から70年代初頭にかけて製作された幾多のバイカーズ・ムービー。 <BR>


 <BR>
いずれもチープなストーリー性を持ち、作品としてのクオリティーには疑問符を付けざるを得ませんが、その映像のカッコ良さには独特の物があります。  <BR>


<BR>今回ご紹介するのは、各映画の公開時に宣伝用に製作されたポスターの精巧なレプリカ。
 <BR>


 <BR>専用のポスターペーパーを使用し、カラーリングも忠実に再現。  <BR>



<BR>現地での価格も高騰し、球数も激減しているこれらのポスターがリーズナブルなプライスで入手可能となりました。 
 <BR>



